import httpClient from "@/utils/httpclient";
export default {
  name: "shopManager",
  data: function data() {
    return {
      tableFields: {
        name: {
          label: this.$t('m.shop.shop_name'),
          class: "text-center"
        },
        address: {
          label: this.$t('m.shop.shop_address'),
          class: "text-center"
        },
        info: {
          label: this.$t('m.shop.manager_info'),
          class: "text-center"
        },
        actions: {
          label: this.$t('m.vehicle.actions'),
          class: "Actions"
        }
      },
      table: null,
      currentPage: 1,
      pageSize: 10,
      total: 0,
      totalPages: 0,
      showTip: false,
      curName: '',
      curAdminList: []
    };
  },
  mounted: function mounted() {
    this.initData(this.currentPage, this.pageSize);
  },
  methods: {
    showMore: function showMore(name, data) {
      this.curAdminList = data;
      this.curName = this.$t('m.add_shop.store_admin', {
        name: name
      });
      this.showTip = true;
    },
    initData: function initData(page) {
      var _this = this;

      httpClient.get("/api/v1/store/pagelist?pageNo=".concat(page, "&pageSize=").concat(this.pageSize)).then(function (response) {
        _this.total = response.data.data.rowCount;

        _this.filterData(response.data.data);

        _this.totalPages = response.data.data.totalPages;
      });
    },
    filterData: function filterData(data) {
      var self = this;
      this.table = data.datas.map(function (item) {
        var address = "";

        if (self.$i18n.locale === "en-US") {
          address = "".concat(item.countryEn ? item.countryEn : 'N/A', ",").concat(item.stateEn ? item.stateEn : 'N/A', ",").concat(item.cityEn ? item.cityEn : 'N/A', ", ").concat(item.streetAddress ? item.streetAddress : 'N/A');
        } else {
          address = "".concat(item.country ? item.country : 'N/A', ",").concat(item.state ? item.state : 'N/A', ",").concat(item.city ? item.city : 'N/A', ",").concat(item.streetAddress ? item.streetAddress : 'N/A');
        }

        return {
          name: item.storeName,
          address: address,
          info: item.userList && item.userList.length > 0 ? item.userList : 'N/A',
          id: item.id
        };
      });
    }
  }
};
